import React from 'react';
import { Typography, Grid, Container, Box } from '@mui/material';
import defaultPersonImage from '../assets/people/default.jpg';

function Alumni() {
    const alumni = [
        { name: "Wenqing Luo", role: "MS Thesis; First Employment: Apple", image: defaultPersonImage },
        { name: "Shubhi Jain", role: "MCS student", image: defaultPersonImage },
        { name: "Abhi Wangoo", role: "undergrad", image: defaultPersonImage },
        { name: "Akul Gupta", role: "undergrad", image: defaultPersonImage },
        { name: "Amaan Khan", role: "undergrad", image: defaultPersonImage }
      ];
    

  return (  
    <Container sx={{ pt: 10, pb: 5, textAlign: 'center',       backgroundColor: '#f0f0f0',    width: "100%" }}>
      <Typography variant="h4" sx={{ mb: 4, mt: 2, fontWeight: 'bold' }}>
        Alumni
      </Typography>
      <Grid container spacing={4} justifyContent="center">
        {alumni.map((person, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Box sx={{ textAlign: 'center' }}>
              <img src={person.image} alt={person.name} style={{ borderRadius: '50%', width: '150px', height: '150px', objectFit: 'cover' }} />
              <Typography variant="h6" sx={{ fontWeight: 'bold', mt: 2, color: '#ff6600' }}>{person.name}</Typography>
            </Box>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default Alumni;
